#![no_main] // pick a panicking behavior
extern crate panic_halt; // you can put a breakpoint on `rust_begin_unwind` to catch panics
// extern crate panic_abort; // requires nightly
// extern crate panic_itm; // logs messages over ITM; requires ITM support
// extern crate panic_semihosting; // logs messages to the host stderr; requires a debugger use cortex_m_rt::entry; #[entry]
fn main() -> ! { loop { // your code goes here }
} This program is a bit different from a standard Rust program so let's take a closer look. #![no_std] indicates that this program will not link to the standard crate, std . Instead it will link to its subset: the core crate. #![no_main] indicates that this program won't use the standard main interface that most Rust programs use. The main (no pun intended) reason to go with no_main is that using the main interface in no_std context requires nightly. extern crate panic_halt; . This crate provides a panic_handler that defines the panicking behavior of the program. More on this later on. #[entry] is an attribute provided by the cortex-m-rt crate that's used to mark the entry point of the program. As we are not using the standard main interface we need another way to indicate the entry point of the program and that'd be #[entry] . fn main() -> ! . Our program will be the only process running on the target hardware so we don't want it to end! We use a divergent function (the -> ! bit in the function signature) to ensure at compile time that'll be the case.

