Next, let's see how to run an embedded program on QEMU! This time we'll use the hello example which actually does something. For convenience here's the source code of src/main.rs : $ cat examples/hello.rs //! Prints "Hello, world!" on the host console using semihosting #![no_main]
#![no_std] extern crate panic_halt; use core::fmt::Write; use cortex_m_rt::entry;
use cortex_m_semihosting::{debug, hio}; #[entry]
fn main() -> ! { let mut stdout = hio::hstdout().unwrap(); writeln!(stdout, "Hello, world!").unwrap(); // exit QEMU or the debugger section debug::exit(debug::EXIT_SUCCESS); loop {}
} This program uses something called semihosting to print text to the host console. When using real hardware this requires a debug session but when using QEMU this Just Works. Let's start by compiling the example: $ cargo build --example hello The output binary will be located at target/thumbv7m-none-eabi/debug/examples/hello . To run this binary on QEMU run the following command: $ qemu-system-arm \ -cpu cortex-m3 \ -machine lm3s6965evb \ -nographic \ -semihosting-config enable=on,target=native \ -kernel target/thumbv7m-none-eabi/debug/examples/hello
Hello, world! The command should successfully exit (exit code = 0) after printing the text. On *nix you can check that with the following command: $ echo $?
0 Let me break down that long QEMU command for you: qemu-system-arm . This is the QEMU emulator. There are a few variants of these QEMU binaries; this one does full system emulation of ARM machines hence the name. -cpu cortex-m3 . This tells QEMU to emulate a Cortex-M3 CPU. Specifying the CPU model lets us catch some miscompilation errors: for example, running a program compiled for the Cortex-M4F, which has a hardware FPU, will make QEMU error during its execution. -machine lm3s6965evb . This tells QEMU to emulate the LM3S6965EVB, a evaluation board that contains a LM3S6965 microcontroller. -nographic . This tells QEMU to not launch its GUI. -semihosting-config (..) . This tells QEMU to enable semihosting. Semihosting lets the emulated device, among other things, use the host stdout, stderr and stdin and create files on the host. -kernel $file . This tells QEMU which binary to load and run on the emulated machine. Typing out that long QEMU command is too much work! We can set a custom runner to simplify the process. .cargo/config has a commented out runner that invokes QEMU; let's uncomment it: $ head -n3 .cargo/config [target.thumbv7m-none-eabi]
# uncomment this to make `cargo run` execute programs on QEMU
runner = ["qemu-system-arm", "-cpu", "cortex-m3", "-machine", "lm3s6965evb", "-nographic", "-semihosting-config", "enable=on,target=native", "-kernel"] This runner only applies to the thumbv7m-none-eabi target, which is our default compilation target. Now cargo run will compile the program and run it on QEMU: $ cargo run --example hello --release Compiling app v0.1.0 (file:///tmp/app) Finished release [optimized + debuginfo] target(s) in 0.26s Running `qemu-system-arm -cpu cortex-m3 -machine lm3s6965evb -nographic -semihosting-config enable=on,target=native -kernel target/thumbv7m-none-eabi/release/examples/hello`
Hello, world!

