Exceptions, and interrupts, are a hardware mechanism by which the processor handles asynchronous events and fatal errors (e.g. executing an invalid instruction). Exceptions imply preemption and involve exception handlers, subroutines executed in response to the signal that triggered the event. The cortex-m-rt crate provides an exception attribute to declare exception handlers. // Exception handler for the SysTick (System Timer) exception
#[exception]
fn SysTick() { // ..
} Other than the exception attribute exception handlers look like plain functions but there's one more difference: exception handlers can not be called by software. Following the previous example, the statement SysTick(); would result in a compilation error. This behavior is pretty much intended and it's required to provide a feature: static mut variables declared inside exception handlers are safe to use. #[exception]
fn SysTick() { static mut COUNT: u32 = 0; // `COUNT` has type `&mut u32` and it's safe to use *COUNT += 1;
} As you may know, using static mut variables in a function makes it non-reentrant . It's undefined behavior to call a non-reentrant function, directly or indirectly, from more than one exception / interrupt handler or from main and one or more exception / interrupt handlers. Safe Rust must never result in undefined behavior so non-reentrant functions must be marked as unsafe . Yet I just told that exception handlers can safely use static mut variables. How is this possible? This is possible because exception handlers can not be called by software thus reentrancy is not possible.

