The HardFault exception is a bit special. This exception is fired when the program enters an invalid state so its handler can not return as that could result in undefined behavior. Also, the runtime crate does a bit of work before the user defined HardFault handler is invoked to improve debuggability. The result is that the HardFault handler must have the following signature: fn(&ExceptionFrame) -> ! . The argument of the handler is a pointer to registers that were pushed into the stack by the exception. These registers are a snapshot of the processor state at the moment the exception was triggered and are useful to diagnose a hard fault. Here's an example that performs an illegal operation: a read to a nonexistent memory location. NOTE : This program won't work, i.e. it won't crash, on QEMU because qemu-system-arm -machine lm3s6965evb doesn't check memory loads and will happily return 0 on reads to invalid memory. #![no_main]
#![no_std] extern crate panic_halt; use core::fmt::Write;
use core::ptr; use cortex_m_rt::{entry, exception, ExceptionFrame};
use cortex_m_semihosting::hio; #[entry]
fn main() -> ! { // read a nonexistent memory location unsafe { ptr::read_volatile(0x3FFF_FFFE as *const u32); } loop {}
} #[exception]
fn HardFault(ef: &ExceptionFrame) -> ! { if let Ok(mut hstdout) = hio::hstdout() { writeln!(hstdout, "{:#?}", ef).ok(); } loop {}
} The HardFault handler prints the ExceptionFrame value. If you run this you'll see something like this on the OpenOCD console. $ openocd
(..)
ExceptionFrame { r0: 0x3ffffffe, r1: 0x00f00000, r2: 0x20000000, r3: 0x00000000, r12: 0x00000000, lr: 0x080008f7, pc: 0x0800094a, xpsr: 0x61000000
} The pc value is the value of the Program Counter at the time of the exception and it points to the instruction that triggered the exception. If you look at the disassembly of the program: $ cargo objdump --bin app --release -- -d -no-show-raw-insn -print-imm-hex
(..)
ResetTrampoline: 8000942: movw r0, #0xfffe 8000946: movt r0, #0x3fff 800094a: ldr r0, [r0] 800094c: b #-0x4 <ResetTrampoline+0xa> You'll see that a load operation ( ldr r0, [r0] ) caused the exception and that the value of the register r0 was 0x3fff_fffe at that time. This value matches the r0 field of ExceptionFrame .

